import React from 'react'
import {View, Text} from 'react-native'

const ModalScreen = () => {

    useEffect(() => {
        navigation.setOptions({
           headerShown: true,
        });
    }, [navigation]);

    return(
        <View>
            <Text>I am the modal screen.</Text>
        </View>
        )
}

export default ModalScreen
